import React from "react";
import { useSelector } from "react-redux";
import "../styles/table.css";

function Table() {
    const notebooks = useSelector((state) => state.dataReducer.notebooks);
    const parameters = useSelector((state) => state.dataReducer.parameters);

    return (
        <div className="table-wrap">
            <table className="table-notebooks">
                <thead>
                    <tr>
                        <th></th>
                        {parameters.map((parameter) => (
                            <th className="title-column">{parameter}</th>
                        ))}
                    </tr>
                </thead>
                <tbody>
                    {notebooks.map((notebook) => (
                        <>
                            <th>{notebook.name}</th>
                            <td>{notebook.resolution}</td>
                            <td>{notebook.year}</td>
                            <td>{notebook.memory}</td>
                            <td>{notebook.screen}</td>
                            <td>{notebook.RAM}</td>
                            <td>{notebook.disk}</td>
                            <td>{notebook["CPU frequency"]}</td>
                        </>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default Table;
